import ReduxLoginForm from "./LoginForm/ReduxLoginForm";
import css from "./Login.module.css";

const Login = (props) => {
  return (
    <div>
      <h1>Login</h1>
      <ReduxLoginForm />
    </div>
  );
};

export default Login;
